function arclab_Submit()
{
if(strtolower($_SERVER['REQUEST_METHOD'])!=='post')arclab_SubmitDone('E001 (NOPOST)');
function ErrorCancel($error){arclab_SubmitDone('E300 (CUSTPHP) '.$error);}
function Download($uri){return arclab_GetURL($uri);}
function ToHtml($txt){return arclab_VarToHTML($txt);}
